script: |
  super -f text -I q61.spq | sort > q61.out

inputs:
  - name: q61.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 BETWEEN NULL AND + - col1 / + col2 * - col1 + + CAST ( NULL AS INTEGER ) * col0;
  - name: tab0

outputs:
  - name: q61.out
    data: |
